struct qd_struct_t *QD_2PI = &QD_TRIG[0];
struct qd_struct_t *QD_PI_1024 = &QD_TRIG[1];

// Trigonometric helpers

void qd_nint(qd_t r, qd_t x)
{
    double x0, x1, x2, x3;
    
    x0 = round(x->data[0]);
    x1 = x2 = x3 = 0.0;
    if (x0 == x->data[0])
    {
        x1 = round(x->data[1]);
        if (x1 == x->data[1])
        {
            x2 = round(x->data[2]);
            if (x2 == x->data[2])
            {
                x3 = round(x->data[3]);
            }
            else
            {
                if (fabs(x2 - x->data[2]) == 0.5 && x->data[3] < 0.0) // adjust
                    x2 -= 1.0;
            }
        }
        else
        {
            if (fabs(x1 - x->data[1]) == 0.5 && x->data[2] < 0.0) // adjust
                x1 -= 1.0;
        }
    }
    else
    {
        if (fabs(x0 - x->data[0]) == 0.5 && x->data[1] < 0.0) // adjust
            x0 -= 1.0;
    }

    qd_renormalize(r, x0, x1, x2, x3, 0.0);
}

void qd_floor(qd_t r, qd_t x)
{
    double x0, x1, x2, x3;

    x0 = floor(x->data[0]);
    x1 = x2 = x3 = 0.0;
    if (x0 == x->data[0])
    {
        x1 = floor(x->data[1]);
        if (x1 == floor(x->data[1]))
        {
            x2 = floor(x->data[2]);
            if (x2 == x->data[2])
            {   
                x3 = floor(x->data[3]);
            }
        }
    }

    qd_renormalize(r, x0, x1, x2, x3, 0.0);
}

void qd_sin_taylor(qd_t r, qd_t x)
{
	qd_t t, m2, accum, b;
	int i = 1;

	qd_set_zero(accum, 1);
	qd_set(t, x);
	qd_mul(m2, x, x);
	qd_neg(m2, m2);
	while (i < 20)
	{
		qd_mul(b, t, &qd_inv_fact_table[i]);
		qd_add(accum, accum, b);
		qd_mul(t, t, m2);
		i += 2;
	}

	qd_set(r, accum);
}

void qd_cos_taylor(qd_t r, qd_t x)
{
	qd_t t, m2, accum, b;
	int i = 0;

	qd_set_zero(accum, 1);
	qd_set_d(t, 1.0);
	qd_mul(m2, x, x);
	qd_neg(m2, m2);
	while (i < 19)
	{
		qd_mul(b, t, &qd_inv_fact_table[i]);
		qd_add(accum, accum, b);
		qd_mul(t, t, m2);
		i += 2;
	}

	qd_set(r, accum);
}


// Exported trig functions

void qd_sin(qd_t r, qd_t x)
{
    qd_t x0, x1, x2, mpi2, mpi1024;
	qd_t t, s, c, ls, lc;
	int offset;

    // Modulo 2pi
    qd_div(t, x, QD_2PI);
    qd_nint(t, t);
    qd_mul(t, t, QD_2PI);
    qd_sub(x0, x, t);

    // Modulo pi/2
    qd_div(mpi2, x0, QD_PI_2);
    qd_nint(mpi2, mpi2);
    qd_mul(t, mpi2, QD_PI_2);
    qd_sub(x1, x0, t);

    // Modulo pi/1024
    qd_div(mpi1024, x1, QD_PI_1024);
    qd_nint(mpi1024, mpi1024);
    qd_mul(t, mpi1024, QD_PI_1024);
    qd_sub(x2, x1, t);

    // taylor series on reduced argument
	qd_sin_taylor(s, x2);
	qd_cos_taylor(c, x2);
	
	// sin, cos table lookup
	offset = (int)mpi1024->data[0];
	if (offset < 0)
	{
		qd_set(ls, &qd_sin_table[-offset]);
		qd_set(lc, &qd_cos_table[-offset]);
		qd_neg(ls, ls);
	}
	else
	{
		qd_set(ls, &qd_sin_table[offset]);
		qd_set(lc, &qd_cos_table[offset]);
	}

	// adjust result by quadrant: -2, -1, 0, 1, 2
	if (mpi2->data[0] == -1.0)
	{
		qd_mul(s, s, ls);
		qd_mul(c, c, lc);
		qd_sub(r, c, s);
		qd_neg(r, r);
	}
	else if (mpi2->data[0] == 0.0)
	{
		qd_mul(s, s, lc);
		qd_mul(c, c, ls);
		qd_add(r, s, c);
	}
	else if (mpi2->data[0] == 1.0)
	{
		qd_mul(s, s, ls);
		qd_mul(c, c, lc);
		qd_sub(r, c, s);
	}
	else
	{
		qd_mul(s, s, lc);
		qd_mul(c, c, ls);
		qd_add(r, s, c);
		qd_neg(r, r);
	}
}